@import '../core/colors';
@import '../core/radius';

@mixin button-transition {
  transition: color 0.20s ease-in-out, background-color 0.20s ease-in-out;
}

.pansa-button {
  @include button-transition;
  border: none;
  border-radius: $radius;
  padding: 10px 16px;
  cursor: pointer;
  font-weight: 400;

  &.pansa-button-primary {
    background-color: $color-primary;
    color: $color-secondary;

    &:hover {
      background-color: $color-muted;
    }
  }

  &.pansa-button-secondary {
    background-color: $color-secondary;
    color: $color-text-main-light;

    &:hover {
      background-color: #8ED4ED;
    }
  }

  &.pansa-button-action {
    background-color: $color-action;
    color: $color-text-main;

    &:hover {
      background-color: #C4007A;
    }
  }

  &.pansa-button-danger {
    background-color: $color-danger;
    color: $color-text-main;

    &:hover {
      background-color: darken($color-danger, 10%);
    }
  }

  &.pansa-button-transparent {
    background-color: transparent;
    color: $color-text-main;

    &:hover {
      background-color: rgba($color-text-main, 0.1);
    }
  }


  &.pansa-button-large {
    padding: 10px 18px;
    font-size: 16px;
    font-weight: 600;
  }

  &.pansa-button-medium {
    padding: 10px 16px;
    font-size: 14px;
  }

  &.pansa-button-small {
    padding: 8px 14px;
    font-size: 14px;
  }
}

